INSERT INTO public.up_roles (name,description,"type",created_at,updated_at,created_by_id,updated_by_id) VALUES
	 ('Authenticated','Default role given to authenticated user.','authenticated','2023-03-10 20:28:50.041','2023-03-10 20:28:50.041',NULL,NULL),
	 ('Public','Default role given to unauthenticated user.','public','2023-03-10 20:28:50.097','2023-03-10 20:28:50.097',NULL,NULL),
	 ('Student','The students who will access the portal will be able to view circulars, assignments, fees due, exams & results. They''ll be able to submit assignments and upload fee receipts.','student','2023-03-10 23:16:47.846','2023-03-10 23:16:47.846',NULL,NULL),
	 ('Class Teacher','Class teacher will be able to view exam result of all students, curriculum progress of all subjects of her class. She can mark student attendance. She can apply for her on leaves and approve leaves of students.','class_teacher','2023-03-10 23:42:23.426','2023-03-10 23:42:23.426',NULL,NULL),
	 ('Subject Teacher','Subject teachers will be able to create and manage assignments. She can edit curriculum progress of her respective subject. She can assign marks.','subject_teacher','2023-03-10 23:47:23.937','2023-03-10 23:47:23.937',NULL,NULL),
	 ('Reception','The receptionist is responsible for adding students and collecting fees and fines from them. They can create ID cards.','reception','2023-03-10 23:14:23.685','2023-03-10 23:50:16.405',NULL,NULL),
	 ('Incharge','Will be able to manage teacher attendance, add classes/sections, create exams, curriculum, circulars and declare exam results.','incharge','2023-03-10 23:56:38.951','2023-03-10 23:56:38.951',NULL,NULL),
	 ('Branch Admin','Branch admin will be able to add faculty, create fees schema, view fee collection, performance and attendance of everyone. Create and manage Circulars. He''ll view exams curriculum progress.','branch_admin','2023-03-11 00:11:41.404','2023-03-11 00:11:41.404',NULL,NULL),
	 ('Admin','Admin will be able to view fees schema, create branch admin and create new branches.','admin','2023-03-11 00:17:10.161','2023-03-11 00:17:10.161',NULL,NULL);
